import React from "react";
import "./CardDias.scss";

const CardDias = props => {
  return (
    <section className="card" style={{ backgroundImage: `url(${props.img})` }}>
      <div className="contenedor-titulo">
        <h1 style={{ color: props.color }}>{props.title}</h1>
        <table>
          <thead>
            <th>Aerobicos</th>
            <tr>
              <td>{props.texto1}</td>
            </tr>
            <tr>
              <td>{props.texto2}</td>
            </tr>
            <tr>
              <td>{props.texto3}</td>
            </tr>
            <th>Localizada</th>
          </thead>
        </table>
      </div>
    </section>
  );
};

export default CardDias;
